#!/usr/bin/env perl
use strict;
use warnings;

=head1 LIVING TREE SELF-EXTRACTING ARCHIVE

This script contains the complete Living Tree workspace encoded as BASE32.
Just run it and it extracts everything!

Usage: perl living_tree_self_extracting.pl

The workspace will be extracted to the current directory.

=cut

print "=" x 70 . "\n";
print "üå≥ Living Tree Self-Extracting Archive üå≥\n";
print "=" x 70 . "\n\n";
print "Extracting workspace...\n";

my $base32_data = '
';

# Clean and decode
$base32_data =~ s/\s+//g;

open my $decoder, '|-', 'base32 -d | tar -xJ' or die "Cannot start decoder: $!\n";
print $decoder $base32_data;
close $decoder;

if ($? == 0) {
    print "\n" . "=" x 70 . "\n";
    print "‚úì Living Tree workspace extracted successfully!\n";
    print "=" x 70 . "\n\n";
    
    if (-d 'core') {
        print "Workspace structure:\n";
        print "  ‚îú‚îÄ‚îÄ core/                    ‚Üê Core implementations\n";
        print "  ‚îú‚îÄ‚îÄ implementations/         ‚Üê Working demos\n";
        print "  ‚îú‚îÄ‚îÄ documentation/          ‚Üê Guides\n";
        print "  ‚îî‚îÄ‚îÄ archives/               ‚Üê Backups\n\n";
        print "Quick start:\n";
        print "  cd core\n";
        print "  perl base32_harmonic_routing.pl\n\n";
        print "üå≥ The Living Tree has grown! üå≥\n";
    } else {
        print "Files extracted to current directory.\n";
    }
} else {
    print "\n‚úó Extraction failed!\n";
    print "Make sure base32 and xz-utils are installed.\n";
    exit 1;
}
